SET search_path to db2024;









UPDATE "rooms" SET "available" = TRUE;
UPDATE "rooms"
SET type = CASE
    WHEN price < 25000 THEN 'Economy'
    WHEN price BETWEEN 25001 AND 50000 THEN 'Standard'
    WHEN price BETWEEN 50001 AND 75000 THEN 'Deluxe'
    WHEN price >= 75001 THEN 'Suite'
    ELSE type
END;
-- Для таблиці hotels
SELECT setval('hotels_id_seq', (SELECT MAX(id) FROM hotels));

-- Для таблиці rooms
SELECT setval('rooms_id_seq', (SELECT MAX(id) FROM rooms));

-- Для таблиці customers
SELECT setval('customers_id_seq', (SELECT MAX(id) FROM customers));
